export default function input({userData, setuserData}) {
  return (

      <input
        type="file"
        name="file"
        accept="image/png, image/jpeg"
        id='img'
        onChange={(e) =>setuserData({...userData, [e.target.name]: e.target.value})}
        />

  )
}
